import React from 'react';

const About = () => {
    return (
        <div className='text-gray-800 text-left px-5'>
            <h2>About</h2>
            <p>I'm a hobby photographer and pizza enthusiast. Fascinated by capturing special moments and feelings.</p>
        </div>
    );
}

export default About;
